def solve(number):
    number = str(number)
    length = len(number)
    mid = length // 2
    left = number[:mid]
    right = number[mid + length % 2:]

    if left[::-1] > right:
        return int(left + right[::-1])
    elif length % 2 == 0:
        return int(left + str(int(right) + 1) + left[::-1])
    else:
        middle = number[mid]
        if middle != '9':
            return int(left + str(int(middle) + 1) + left[::-1])
        else:
            return int(left + '0' + left[::-1])

